annotation:
Black resigns.
A big thanks to patagusto which played this game as black!

There are some important strategic themes in this match:
- the importance of development and of center;
- the power of open lines;
- the weakness on a1-h8 and h4-d8 diagonal;
- the importance of strategy principles also in tactical situations;
- tactical themes of «whirl» (a little one!) and «interference».
